import logo from './logo.svg';
import './App.css';
import ListJ from './components/listJ';
import { BrowserRouter, Outlet, Route, Routes } from 'react-router-dom';
import HomeJ from './components/homeJ';
import Moredetails from './components/moredetails';
import LoginJ from './components/loginJ';
import SignOnJ from './components/signOnJ';
import AddRJ from './components/addRJ';
import Nav from './components/nav';
import './bootstrap.css';

function App() {
  return (
 <div>
    <h1>React Project</h1>
    <BrowserRouter>
    {/* <Route path='/mynav' element={<Nav></Nav>}></Route> */}
    <Nav></Nav>
    <Routes>
      <Route path="/myhome" element={<HomeJ></HomeJ>}>
      <Route path="mymoredetails/:myname/:mydescription/:mypic/:my" element={<Moredetails></Moredetails>}></Route>
      </Route>
      <Route path="/mylogin" element={<LoginJ></LoginJ>}>
      <Route path="myaddr" element={<AddRJ></AddRJ>}></Route>
      </Route>
      <Route path="/mysignon" element={<SignOnJ></SignOnJ>}>
      {/* <Route path="myaddr" element={<AddRJ></AddRJ>}></Route> */}
      </Route>
      <Route path="/mylistusers" element={<ListJ></ListJ>}></Route>

    </Routes>
    </BrowserRouter>
 </div>

  );
}

export default App;
